import React from "react";

import MyPost from './MyPost/MyPost'
import {addPostActionCreator, UpdateNewPostActionCreator} from "../../../redux/profile-reducer";
import MyPosts from "./MyPosts";


const MyPostsContainer = (props) => {
    console.log(props)
    let arr_post = props.posts.map((el, i) => <MyPost massage={el.massage} id={i+1} like={el.like}/>);
    let newPostElement = React.createRef()
    const addPostText = (id) => {
        props.dispatch(addPostActionCreator(id))
    }
    const onPostUpdate = (text) => {

        props.dispatch(UpdateNewPostActionCreator(text) )

    }
    return (<MyPosts updateNewPostText={ onPostUpdate} addPostText={addPostText} />)

}
export default MyPostsContainer
